    public void generate1(final World world, final Random random, final int chunkX, final int chunkY, final int chunkZ) {
        final int j = world.getHeightValue(chunkX, chunkZ) - 6;
        final boolean place = true;
        if (place && (world.getBiomeGenForCoords(chunkX, chunkZ).biomeName.equals(BiomeGenBase.ocean.biomeName) || world.getBiomeGenForCoords(chunkX, chunkZ).biomeName.equals(BiomeGenBase.deepOcean.biomeName))) {
            System.out.println("[FANDOMCRAFT] Beginning Gannon's Tower at (" + chunkX + ", " + j + ", " + chunkZ + ")");
            this.generate2(world, random, chunkX, j, chunkZ);
        }
    }
    
